In Power Automate, you can't directly change the background color of an adaptive card as it's not a supported property. However, you can use a workaround by using an image as the background and overlaying the text and other elements on top of it. Here's a simple example of how you can do this:

1. First, you need an image with a transparent background. You can create one using tools like Adobe Photoshop, GIMP, or even online tools like Canva.

2. Upload this image to a SharePoint library, OneDrive, or any other storage service that Power Automate can access.

3. In your Power Automate flow, add a 'Compose' action to get the URL of the image.

4. Add another 'Compose' action to create the adaptive card. You'll need to use JSON to structure the card. Here's a simple example:

```json
{
    "type": "AdaptiveCard",
    "body": [
        {
            "type": "Image",
            "url": "your_image_url",
            "style": "stretch"
        },
        {
            "type": "TextBlock",
            "text": "Your text here",
            "wrap": true
        }
    ],
    "actions": [
        {
            "type": "Action.Http",
            "title": "Action",
            "url": "your_action_url"
        }
    ]
}
```

Replace `"your_image_url"` with the URL you got in the first 'Compose' action, and `"Your text here"` and `"your_action_url"` with your actual text and action URLs.

5. Send this adaptive card as an output.

This will create an adaptive card with your image as the background and text overlaid on top of it. The text color will depend on the contrast with the image, so you might need to adjust the image or the text color accordingly.

